// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Use Routes and Route from react-router-dom v6+
import Navbar from './components/Navbar';
import Login from './components/Login';
import Register from './components/Register';
import './styles.css';

function App() {
  return (
    <Router>
      <Navbar />
      <div className="container">
        <Routes> {/* Replace Switch with Routes */}
          <Route path="/login" element={<Login />} /> {/* Use element prop instead of component */}
          <Route path="/register" element={<Register />} /> {/* Use element prop instead of component */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
